import React from 'react';

const ProductViewInCart = ({ data }) => {
	console.log(data);
	return (
		<div className='productInCart'>
			<h3>{data.title}</h3>
			<img width='100px' src={data.image} alt='' />
			<style jsx>
				{`
					.productInCart {
						margin-top: 70px;
						border: 1px solid grey;
						background: white;
						border-radius: 8px;
					}
				`}
			</style>
		</div>
	);
};

export default ProductViewInCart;
